var TesteRoute = function(di) {
	di.graoExpress.get('/teste/:id', di.controllers.teste.service.get);
	di.graoExpress.get('/teste', di.controllers.teste.service.query);
	di.graoExpress.post('/teste', di.controllers.teste.service.create);
	di.graoExpress.put('/teste/:id', di.controllers.teste.service.update);
	di.graoExpress.del('/teste/:id', di.controllers.teste.service.destroy);
	di.graoExpress.get('/admin/teste', di.controllers.teste.admin.dashboard);
};
module.exports = exports = TesteRoute;
